import React, { useEffect, useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { NavBar } from './components/NavBar';
import Footer from './components/Footer';
import { PopupWidget } from 'react-calendly';
import HomeScreen from './Screens/HomeScreen';
import logo from './assets/img/logo1.png';
import { lineSpinner } from 'ldrs'; // Adjust import statement for the spinner component
import Leadership from './Screens/Signup/Leadership';
import PageNotFound from './components/PageNotFound';

function App() {
  const [pageLoaded, setPageLoaded] = useState(false);

  useEffect(() => {
    // Simulating a delay of 1000 milliseconds before setting pageLoaded to true
    setTimeout(() => setPageLoaded(true), 1000);
  }, []);

  useEffect(() => {
    // Register lineSpinner only once when the component mounts
    lLineSpinner.register();
  }, []); // Empty dependency array to run this effect only once

  if (!pageLoaded) {
    return (
      <div className='landing'>
        {/* Adjust component name to lLineSpinner */}
        <l-line-spinner
          size='40'
          stroke='3'
          speed='1'
          color='black'
        ></l-line-spinner>
        <img src={logo} alt='Logo' className='logo' />
      </div>
    );
  } else {
    return (
      <BrowserRouter>
        <div className='App'>
          <NavBar />
          <Routes>
            <Route path='/' element={<HomeScreen />} />
            <Route path='/leadership' element={<Leadership />} />
            <Route path='*' element={<PageNotFound />} />
          </Routes>
          <Footer />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
